				<div
					style={{
						borderLeft: "1.5px solid black",
						height: smallerCalculatedWidthTechnologies,
						paddingTop: "16px",
						paddingBottom: "16px",
						paddingRight: "16px",
					}}
				/>
				<Box sx={{
					display: "flex",
					flexDirection: "column",
					justifyContent: "center",
					alignItems: "center",
					width: calculatedHeightTechnologies,
					height: calculatedHeightTechnologies,
					paddingRight: "16px"
